package com.example.demo;

public class Data {
	
	String key;
	Double value;
	public Data() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Data(String key, Double value) {
		super();
		this.key = key;
		this.value = value;
	}
	public String getKey() {
		return key;
	}
	public void setKey(String key) {
		this.key = key;
	}
	public Double getValue() {
		return value;
	}
	public void setValue(Double value) {
		this.value = value;
	}
	
	

}
